import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import { Router, Routes, Route } from "react-router-dom";

import "./styles.css";

const rootElement = document.getElementById("root");
ReactDOM.render(
  <React.StrictMode>
    <Router>
      <App />
    </Router>
  </React.StrictMode>,
  rootElement
);
